(35, 1, '2024-03-06 09:14:45', '2024-03-06 02:14:45', '<!-- wp:paragraph -->\n<p>Đây là trang mẫu. Nó khác với bài viết bởi vì nó thường cố định và hiển thị trong menu của bạn. Nhiều người bắt đầu với trang Giới thiệu nơi bạn chia sẻ thông tin cho những ai ghé thăm. Nó có thể bắt đầu như thế này:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Chào bạn! Tôi là một người bán hàng, và đây là website của tôi. Tôi sống ở Hà Nội, có một gia đình nhỏ, và tôi thấy cách sử dụng WordPress rất thú vị.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... hoặc cái gì đó như thế này:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Công ty chúng tôi được thành lập năm 2010, và cung cấp dịch vụ chất lượng cho rất nhiều sự kiện tại khắp Việt Nam. Với văn phòng đặt tại Hà Nội, TP. Hồ Chí Minh cùng hơn 40 nhân sự, chúng tôi là nơi nhiều đối tác tin tưởng giao cho tổ chức các sự kiện lớn.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Là một người dùng WordPress mới, bạn nên ghé thăm <a href=\"https://qlnckh.online/wp-admin/\">bảng tin</a> để xóa trang này và tạo trang mới cho nội dung của chính bạn. Chúc bạn vui vẻ!</p>\n<!-- /wp:paragraph -->', 'Trang Mẫu', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2024-03-06 09:14:45', '2024-03-06 02:14:45', '', 2, 'http://localhost/NCKH/?p=35', 0, 'revision', '', 0),
(47, 1, '2024-03-06 11:34:04', '2024-03-06 04:34:04', '<!-- wp:template-part {\"slug\":\"header\",\"theme\":\"twentytwentyfour\",\"tagName\":\"header\",\"area\":\"header\"} /-->\n\n<main class=\"wp-block-group\" style=\"margin-top:0\">\n	\n	<div class=\"container-fluid \">\n        <form class=\"form form-vertical\" method=\"POST\" action=\"#\" enctype=\"multipart/form-data\">\n            <div class=\"form-body\">\n                <div class=\"row\">\n                <div class=\"col-12\">\n                        <div class=\"form-group\">\n                            <label for=\"workoutdate\">Work out Date</label>\n                            <input type=\"date\" id=\"workoutdate\" class=\"form-control\" name=\"workoutdate\">\n                        </div>\n                    </div>\n                    <div class=\"col-12\">\n                        <div class=\"form-group\">\n                            <label for=\"activity\">Activity</label>\n                            <input type=\"text\" id=\"activity\" class=\"form-control\" name=\"activity\" value=\"\">\n                        </div>\n                    </div>\n                    \n                    <div class=\"col-12\">\n                        <div class=\"form-group\">\n                            <label for=\"time_mins\">Times in Min</label>\n                            <input type=\"text\" id=\"time_mins\" class=\"form-control\" name=\"time_mins\" value=\"\">\n                        </div>\n                    </div>\n                   \n                    <div class=\"col-12 d-flex justify-content-end mt-3\">\n                        <button type=\"submit\" class=\"btn btn-warning me-1 mb-1 rounded-pill\" name=\"Add\">Submit</button>\n                    </div>\n                </div>\n            </div>\n        </form>\n                \n        </div> <!--container-->\n</main>\n\n<!-- wp:template-part {\"slug\":\"footer\",\"theme\":\"twentytwentyfour\",\"tagName\":\"footer\",\"area\"